import React from "react";
import { AiFillCaretLeft, AiFillCaretRight } from "react-icons/ai";

const Projects = ({ projects }) => {
  console.log({ projects });
  return (
    <div className="projects">
      <h1>Projects</h1>
      <div className="project">
        <button>
          <AiFillCaretLeft />
        </button>

        <button>
          <AiFillCaretRight />
        </button>
      </div>
    </div>
  );
};

export default Projects;
